import React from 'react';

const reactContentRoot = document.getElementById("root");

const App = () => {
  const myItem = "Harry";
  return (
    <ul>
      <li>
        <h1>Hello World</h1>
      </li>
      <li>{myItem.toUpperCase()}</li>
    </ul>
  );
};

const root = ReactDOM.createRoot(reactContentRoot); 
root.render(<App />);

export default App
